INSERT INTO `reviews` (`name`, `title`, `review`, `rating`, `asin`, `brand`, `model`, `link`, `img`, `id`) VALUES
('tristazbimmer', 'Great phone service and options, lousy case!', 'The phone has been great for every purpose it offers, except the day i bought it-i couldnt get the case off. You can take the case off to put your own pictures in the jaket which is super cool, but when i took it back to the store-an employee said they were meant to be hard to get off. Well, he could barely even get it off- he came close to snapping the casing in half. I was never able to get it off after that which isnt THAT big of a deal, but it got dirty under the clear casing and it looks really dirty now. MAKE SURE YOU CAN GET YOUR CASE ON AND OFF! Oh and you have to charge it ALL off the time.', 4, 'B001DCJAJG', 'Motorola', 'Motorola V365 no contract cellular phone AT&T', 'https://www.amazon.com/Motorola-V365-contract-cellular-phone/dp/B001DCJAJG', 'https://m.media-amazon.com/images/I/61LYNCVrrKL._AC_UY218_ML3_.jpg', 2),
('J. White', 'Worked great for me', 'Hello, I have this phone and used it until I decided to buy a flip phone. I have had NO problems with the battery or new cases--it has a new fish case on it now and it stays as well as the original one. I have added ring tones, and music so it was all good for me--as a matter of fact I am willing to sell this phone, the home charger and the car charger for a great deal--email me--(...)', 4, 'B001GQ3DJM', 'Nokia', 'Nokia 1680 Black Phone (T-Mobile)', 'https://www.amazon.com/Nokia-1680-Black-Phone-T-Mobile/dp/B001GQ3DJM', 'https://m.media-amazon.com/images/I/41X4VeqkFOL._AC_UY218_ML3_.jpg', 3),
('Matt', 'Problem with 3588i universal headset', 'The 3599i is overall a nice phone, except that Nokia made its universal headset jack incompatible with most 2.5mm universal headsets (even their own). A phone call to tech support was required to find out that you need to buy a headset that plugs into the Pop-port accessory connector on the bottom of the phone. They ended up suggesting the HDB-5 headset.', 4, 'B002AS9WEA', 'Samsung', 'Samsung a167 Prepaid GoPhone (AT&T)', 'https://www.amazon.com/Samsung-a167-Prepaid-GoPhone-AT/dp/B002AS9WEA', 'https://m.media-amazon.com/images/I/61OXcZ-oefL._AC_UY218_ML3_.jpg', 4),
('Amazon Customer', 'Pissed off-a little bit', 'ok well im in school and i need the text messaging and ive had this phone for about a month and text messaging was supposed to start working 2weeks ago.A conflict of software type stuff and btween nokia and sprint.(Its down to 4 stars) And the fact it cant download ringtones.(3stars)Or games(2 stars)But you cant beat a nearfree or free color phone(back to 3 stars) as soon as it gets text messaging it should b 4 stars.', 3, 'B002WTC1NG', 'Motorola', 'Motorola Barrage V860 Phone (Verizon Wireless)', 'https://www.amazon.com/Motorola-Barrage-V860-Verizon-Wireless/dp/B002WTC1NG', 'https://m.media-amazon.com/images/I/81k6Nq0KI1L._AC_UY218_ML3_.jpg', 5),
('brittho', 'Great free phone for Sprint customers.', 'This is an excellent choice for Sprint to use when enrolling new customers for service. It is the free option for most new customers and it has been excellent after a year of ownership. I love how it lights up when someone is calling which helps to really find the phone quickly when you are in the dark. If you have the phone in a purse it really makes it easy to find due to this fact. The Nokia phone seems to be tougher to me than the Samsung phones at the Sprint store also. So my only issue with the phone is the fact that since it is not a flip phone the keypad must be locked before I drop the phone in my pants pocket. This can be annoying if you get used to owning a flip phone before movin', 4, 'B003W646YK', 'Motorola', 'Motorola i570 Nextel iDen PTT rugged black cell phone', 'https://www.amazon.com/Motorola-i570-Nextel-rugged-black/dp/B003W646YK', 'https://m.media-amazon.com/images/I/51oFJfZ-LcL._AC_UY218_ML3_.jpg', 6),
('William B.', 'Exellent Service', 'I have been with nextel for nearly a year now I started out this time last year with the Motorola i205 and just upgraded to the i265 it is one of the best phones I have ever had the service is the best I have ever had I have no problems making or reciving calls. If you are considering nextel give it a shot they are in my opinion the best cell company out there.', 4, 'B0046REOWS', 'Samsung', 'Samsung T201G Prepaid Phone (Net10)', 'https://www.amazon.com/Samsung-T201G-Prepaid-Phone-Net10/dp/B0046REOWS', 'https://m.media-amazon.com/images/I/91zoUJ+sJKL._AC_UY218_ML3_.jpg', 7),
('K. Mcilhargey', 'I love it', 'I just got it and have to say its easy to use, i can hear the person talking just fine and i have had no problems dealing with nextel.', 5, 'B004C7NVD0', 'Samsung', 'Samsung Convoy SCH-U640 Cell Phone Ruggedized PTT 2+ megapixel Camera for Verizon', 'https://www.amazon.com/Samsung-SCH-U640-Ruggedized-megapixel-Verizon/dp/B004C7NVD0', 'https://m.media-amazon.com/images/I/61ve0RjDSUL._AC_UY218_ML3_.jpg', 8),
