('S. Chan', 'simply great!', 'Easy to use features, slim in size at a very good price. It is better compare to my exsiting T-Mobile prepaid phone. I called from a landline to both phones and the at& t picked up within 13 seconds while the T-Mobile at 25 sec or most of the time, just jumped to my voice mail only. I highly recommend at&t.', 5, 'B00A2V7BA4', 'Nokia', 'Nokia Lumia 920, Black 32GB (AT&T)', 'https://www.amazon.com/Nokia-Lumia-920-Black-32GB/dp/B00A2V7BA4', 'https://m.media-amazon.com/images/I/61UTfUPGH1L._AC_UY218_ML3_.jpg', 18),
