('Clay', 'Not a \"Boost\" phone. Description is lie.', 'This is not a \"boost\" phone and will not work as a GPS with Boost. Had to send it back. A huge pain for something that is $24. This is a rip-off.', 1, 'B00E8TGT1S', 'Nokia', 'Nokia Lumia 520 Quad-Band GSM Unlocked Smartphone - Blue', 'https://www.amazon.com/Nokia-Lumia-Quad-Band-Unlocked-Smartphone/dp/B00E8TGT1S', 'https://m.media-amazon.com/images/I/61huy0bRgEL._AC_UY218_ML3_.jpg', 24),
('BeckyTheBookWorm', 'good phone', 'good phone works well. very simple to use.dropped a few times and still works fine.', 5, 'B00EP2BN00', 'Samsung', 'Samsung Convoy 3, Gray (Verizon Wireless)', 'https://www.amazon.com/Samsung-Convoy-Gray-Verizon-Wireless/dp/B00EP2BN00', 'https://m.media-amazon.com/images/I/71Q7aSSyOkL._AC_UY218_ML3_.jpg', 25),
('jennyjerez', 'Great Phone', 'You get the basic functions for what a cell phone is needed for, in other words this phone is simple and effective.', 5, 'B00F1HVZ0Q', 'Samsung', 'Samsung Galaxy S4 M919 16GB T-Mobile 4G LTE Smartphone - Black Mist', 'https://www.amazon.com/Samsung-Galaxy-M919-T-Mobile-Smartphone/dp/B00F1HVZ0Q', 'https://m.media-amazon.com/images/I/51hnjqGbVqL._AC_UY218_ML3_.jpg', 26),
('Gabriel Barco', 'GREAT PHONE', 'i dont want to sound like a hot head but i havent had the best luck with cell phones, when i get a bad call the phone goes flying. this phone has impressed me with its durablity, i have thrown it, droped it and it even went flying out of my cars window while on the street when i wasnt looking, and it still works. best phone i ever bought. why would you buy a phone that cost $400 and worry every time you drop it, when if this one falls you just brush off the dirt and go on your way.', 5, 'B00HE5834Y', 'Motorola', 'Motorola Droid Ultra XT1080 16GB 4G LTE Android Smartphone W/ 10MP Camera - Black', 'https://www.amazon.com/Motorola-XT1080-Android-Smartphone-Camera/dp/B00HE5834Y', 'https://m.media-amazon.com/images/I/81p5bS9i6dL._AC_UY218_ML3_.jpg', 27),
('M. reyeshernandez', 'RUGGED', 'it withstands a lot and is worth the money only thing IT DOESNT HAVE A CAMERA', 5, 'B00JEHJMG8', 'Samsung', 'Samsung Galaxy S4 16GB SPH-L720 4G LTE Android - Sprint (Blue)', 'https://www.amazon.com/Samsung-Galaxy-SPH-720T-Tri-Band-Sprint/dp/B00JEHJMG8', 'https://m.media-amazon.com/images/I/61Uy8S7wD9L._AC_UY218_ML3_.jpg', 28),
('poppamiller', 'Motorola V365', 'The shipping time on the phone was great, The phone also works great and as it is supose to, My sims card had no problems as some stated theirs did, great battery life, nice looking phone. Work in a area that my other phone had no signal this phone does when clear out, Not so good when cloudy, But would buy again from seller. Thank you Mark', 5, 'B00JH2WPO6', 'Samsung', 'Samsung ATIV SE, Silver 16GB (Verizon Wireless)', 'https://www.amazon.com/Samsung-ATIV-SE-Verizon-Wireless/dp/B00JH2WPO6', 'https://m.media-amazon.com/images/I/81U-7YS706L._AC_UY218_ML3_.jpg', 29),
('Amy', 'Three Stars', 'Purchased 2 and one worked....', 3, 'B00JS73V2U', 'Motorola', 'Motorola DROID MAXX, Black 16GB (Verizon Wireless)', 'https://www.amazon.com/Motorola-DROID-MAXX-Verizon-Wireless/dp/B00JS73V2U', 'https://m.media-amazon.com/images/I/717w0Z516KL._AC_UY218_ML3_.jpg', 30),
