('Brenda W.', 'IT IS OKAY', 'They are showing a cingular phone which is identical to the one that I had ,Instead I got an AT&tT.It is okay but yhe cingular phone has more options.', 3, 'B00K0NS0P4', 'Motorola', 'Motorola Moto G (1st Generation) Unlocked Cellphone, 8GB, White', 'https://www.amazon.com/Motorola-Moto-Generation-Unlocked-Cellphone/dp/B00K0NS0P4', 'https://m.media-amazon.com/images/I/71L5LzVmrcL._AC_UY218_ML3_.jpg', 32),
('Lynn Gamble', 'it is her third one like it. This one is perfect for her', 'My wife loves this phone, it is her third one like it. This one is perfect for her. Thanks.', 5, 'B00KM10ITK', 'Nokia', 'Nokia Lumia 635 8GB Unlocked GSM 4G LTE Windows 8.1 Quad-Core Phone - Black', 'https://www.amazon.com/Nokia-Lumia-Unlocked-Windows-Quad-Core/dp/B00KM10ITK', 'https://m.media-amazon.com/images/I/61WZWpJTYmL._AC_UY218_ML3_.jpg', 33),
('D. Thoreson', 'Old phone may not work with a new SIM card', 'I got this phone because I wanted a phone that would have better reception than my previous phone. However, it never recognized any of the information stored on my SIM card, so it was essentially useless to me.', 2, 'B00LIYEMTC', 'Sony', 'Sony Xperia Z2 - Unlocked (White)', 'https://www.amazon.com/MOBILE-1281-9167-XPERIA-WHITE-D6502/dp/B00LIYEMTC', 'https://m.media-amazon.com/images/I/41ATwBsWGbL._AC_UY218_ML3_.jpg', 34),
('cassandra smith', 'Five Stars', 'Very satisfied', 5, 'B00N532A34', 'Samsung', 'Samsung Galaxy Alpha, Frosted Gold 32GB (AT&T)', 'https://www.amazon.com/Samsung-Galaxy-Alpha-Frosted-Gold/dp/B00N532A34', 'https://m.media-amazon.com/images/I/81IpIT71b7L._AC_UY218_ML3_.jpg', 35),
('Bo Peep', 'lousy phone', 'The good news is that it has a long battery life and is lightweight. But none of that is worth anything if you cant hear the other person. I had a Samsung and a Sony before and never had this problem. The keypad is tough, requiring sledge hammer to push the keys. Bottom line: the phone is cheap, but you get what you pay for. Try Sony or Samsung, their cheapest models work better than this.', 1, 'B00NKRE7MW', 'Samsung', 'Samsung Galaxy Note 4, Frosted White 32GB (Verizon Wireless)', 'https://www.amazon.com/Samsung-Galaxy-Note-Frosted-Wireless/dp/B00NKRE7MW', 'https://m.media-amazon.com/images/I/915izMqyC-L._AC_UY218_ML3_.jpg', 36),
('P. Dharmavarapu', 'Worst Experience with Amazon', 'This is probably the wrost experience i had with Amazon and it costed me $72.00. Both my phones from amazon arrived inright time but without activation. I called AT&T and they could not locate our phone numbers so had to call back amazon and learned that they have not activated our phones. Amazon customer service took good amount of time to do this meanwhile i missed by billing cycle with old cell phone company. This process took about a week, and not to mention the SIM card delivered was not working and amazon had to ship again.', 1, 'B00O15MWOM', 'Nokia', 'Nokia Lumia 530 White - No Contract (T-Mobile)', 'https://www.amazon.com/Nokia-Lumia-530-White-Contract/dp/B00O15MWOM', 'https://m.media-amazon.com/images/I/81ba7gOGt5L._AC_UY218_ML3_.jpg', 37),
('petlover', 'A simple phone for texting and making calls', 'By simple I mean that in a good way, having come from an Envy 2 I am glad to be able to open the phone and dial and not have to deal with clicking OK twice to unlock the \"locked\" screen. Quotes intentional, the screen was only locked when I needed to urgently make a call but had a lot of phantom dialing while in my pocket. So back to the Alias 2 the phone is easy to figure out but does not work in all the ways it is said to work. Specifically I can not get this phone to pair with my blue tooth in my new car. I tried, the car dealer tried and while NO issues are reported with this phone and its blue tooth capabilities I beg to differ! I read another review of a person who had exact same troub', 3, 'B00O2ALRNS', 'Samsung', 'Samsung Galaxy S4 SGH-I337 USA GSM Unlocked Cellphone, 16GB, Frost White', 'https://www.amazon.com/Samsung-Galaxy-SGH-I337-Unlocked-Cellphone/dp/B00O2ALRNS', 'https://m.media-amazon.com/images/I/81suaO+v0mL._AC_UY218_ML3_.jpg', 38),
('Kaity Lynn', 'Good phone for daily use -', 'I have been using this phone for a few days now and I like it. I am not a big \"gadget phone\" fan, preferring a simpler device that does just what I want. The voice quality is acceptable and after a short learning cycle is easy to use. The Alias 2 allows me, a novice texter, to send and receive text messages with no real hassles. The keypad is a great size, even for my larger fingers. I would have given 5 stars, except for the learning curve required to figure the phone out. Not that this is bad, but it is definitely different than the older phones I was used to.', 4, 'B00QHJTOK0', 'Samsung', 'Samsung Galaxy Centura SCH-S738C - (Net10)', 'https://www.amazon.com/Samsung-Galaxy-Centura-SCH-S738C-Net10/dp/B00QHJTOK0', 'https://m.media-amazon.com/images/I/411mIDKCYzL._AC_UY218_ML3_.jpg', 39),
('Karen S. Baird', 'excellent', 'This is a excellent phone great talk time, excellent standby, very user friendly, I may state it takes a little time to get use to but so does it when you change to new anything. The only down fall is the top 3 keys when your texting when you have large fingers, besides that I would recommend this phone to anybody my wife and kids go through phones like water so had many phones but this one is very unique exspecially with the flip screen. The pictures are excellent minus not having a flash i can live with that cause in low light still takes excellent pics. The flashes on all other phones are a joke those are only good for a couple of foot so take how you want but I recommend this phone for a', 5, 'B00V7FY44A', 'Samsung', 'Samsung Galaxy S6 Edge, White Pearl 32GB (Verizon Wireless)', 'https://www.amazon.com/Samsung-Galaxy-S6-Edge-Wireless/dp/B00V7FY44A', 'https://m.media-amazon.com/images/I/814WwhaRVuL._AC_UY218_ML3_.jpg', 40),
('n. country boy', 'never had a problem', 'never had a problem have had this phone for over 1 year camera takes decent not great pics nice big buttons for texting call quality excellent battery life pretty good all in all a happy camper', 4, 'B00WF988BW', 'Samsung', 'Samsung Convoy 3 SCH-U680 Rugged 3G Cell Phone Verizon Wireless', 'https://www.amazon.com/Samsung-Convoy-SCH-U680-Verizon-Wireless/dp/B00WF988BW', 'https://m.media-amazon.com/images/I/71Q7aSSyOkL._AC_UY218_ML3_.jpg', 41),
('Seth B. Tropinsky', 'Wonderful innovative keypad', 'Great phone, which has the comfort of a larger phone, mixed with a very easy to use qwerty keyboard. the keyboard has nice space, and a texture that feels like the kindle. With the touch of a button, the QWERTY turns into 1234, or /?!> ect. Just a need phone, highly recommended.', 5, 'B00WIYFBWI', 'Samsung', 'Samsung Galaxy S6 Edge G925F 32GB Unlocked Phone - Retail Packaging - Black Sapphire', 'https://www.amazon.com/Samsung-Galaxy-G925F-Unlocked-Phone/dp/B00WIYFBWI', 'https://m.media-amazon.com/images/I/71MayBWnHjL._AC_UY218_ML3_.jpg', 42),
