('R. T. M.', 'Buyer beware !!!', 'I like these phones. They are ruggedly built, and they are Water resistant in up to 3 feet for up to 30 minutes. I bought these to replace similar Motorola phones that lasted 5 - 6 years. That being said... Please read this very carefully... These phones are NOT \"NEW\". They are REFURBISHED. After being fully charged, they would lose 25% of that charge in less than 10 - 12 hours, even when hardly used. As these are refurbished, the manufacturer will NOT give you the usual 1-year warranty. Typically only a 30-day warranty. I sent them back to the seller, and bought new phones nearby.', 2, 'B079C1K282', 'Google', 'Google Pixel 2 XL 64 GB, Black (Renewed)', 'https://www.amazon.com/Google-Pixel-XL-Black-Renewed/dp/B079C1K282', 'https://m.media-amazon.com/images/I/71CDE9pG4hL._AC_UY218_ML3_.jpg', 195),
