('Mary E. Civiello', 'Motorola V860', 'We received the phone only to discover the charger did not fit into phone. We had to immediately buy a new charger at Verizon. The following day the rubber lid placed on side of phone fell off. After searching for it for hours in vain.... we placed a strip of electricians tape over one inch opening. It is an opening showing intricate metal parts that should be protected from debris. On a final note we are not going to buy a used phone ever again.', 1, 'B079H6RLKQ', 'Samsung', 'Samsung Galaxy S9 G960U 64GB Unlocked GSM 4G LTE Phone w/ 12MP Camera - Midnight Black', 'https://www.amazon.com/Samsung-Galaxy-S9-Unlocked-Smartphone/dp/B079H6RLKQ', 'https://m.media-amazon.com/images/I/81+h9mpyQmL._AC_UY218_ML3_.jpg', 197),
