('Intheheat', 'Not user friendly or tough', 'The phone is a nuisance. The \"voice command\" function cannot be turned off and it is forever trying to talk to you. It will be in your cell phone pocket, get touched, and start in the \"learning\" routine for voice commands. It is a complete pain. The phone also is supposed to be military grade. It may be if you are in the military recruitment office. In the real world the first phone lasted only a little over a month before the flip section got broken off. The battery cover is virtually impossible to reseal so waterproof goes right out the window. The speaker phone worked for a short period of time before it started getting so garbled that it was useless too. Buy something else.', 1, 'B07PHQ7FBP', 'Sony', 'Sony Xperia 1 Unlocked Smartphone 6.5\" 4K HDR OLED CinemaWide Display, 128GB - Black - (US Warranty)', 'https://www.amazon.com/Sony-Unlocked-Smartphone-CinemaWide-Display/dp/B07PHQ7FBP', 'https://m.media-amazon.com/images/I/71oXhyGDd+L._AC_UY218_ML3_.jpg', 335),
('Roger C.', 'Longevity', 'I will activate this phone when my other Barge wears out', 5, 'B07PR1Z2BF', 'Motorola', 'Moto Z3 Play - Unlocked - 32 GB - Deep Indigo (US Warranty) - Verizon, AT&T, T-Mobile, Sprint', 'https://www.amazon.com/Moto-Z3-Play-Unlocked-Warranty/dp/B07PR1Z2BF', 'https://m.media-amazon.com/images/I/718hgMPQxML._AC_UY218_ML3_.jpg', 336),
('Glena', 'Made it through water', 'Yesterday, my husband left his phone in his pocket when we went swimming. My daughter noticed it under water after about 30 minutes. However, it now still works just fine!', 5, 'B07PV7LN4X', 'Samsung', 'Samsung Galaxy A30 Dual SIM 32GB (SM-A305G/DS) Unlocked Phone GSM International Version - Blue', 'https://www.amazon.com/Samsung-A30-SM-A305G-Unlocked-International/dp/B07PV7LN4X', 'https://m.media-amazon.com/images/I/71i9lcnWT1L._AC_UY218_ML3_.jpg', 337),
('Marshall A. Childs', 'DO NOT BUY MOTOROLA EVER!', 'I purchased a Droid 2x almost 2 years ago. Over year ago Motorola stopped providing upgrades and the phone has missed calls and needs rebooting regularly. It does not always sync with Google calendar, bee restored to factory, replaced completely 2 times including a new battery and still does not work properly. Motorola and Verizon both refused to replace the phone with a equal phone other than the same one even thought the phone is insured. Go to Best Buy, they honor their warranty with a phone that works equal to what you bought at time of purchase if you have problems.', 1, 'B07PXV5GXJ', 'Xiaomi', 'Xiaomi Redmi 7 32Gb+3GB RAM 6.26\" HD+ LTE Factory Unlocked GMS Smartphone (International Version, No Warranty) - Blue', 'https://www.amazon.com/Xiaomi-Unlocked-Smartphone-International-Warranty/dp/B07PXV5GXJ', 'https://m.media-amazon.com/images/I/51iRhc7-HBL._AC_UY218_ML3_.jpg', 338),
('Nick Rountree', 'Works great, it would have been nice to have the ...', 'Works great, it would have been nice to have the option to purchase the car charger when purchasing the phone.', 5, 'B07PY52GVP', 'Xiaomi', 'Xiaomi Redmi Note 7, 64GB/4GB RAM, 6.30\' FHD+, Snapdragon 660, Black - Unlocked Global Version', 'https://www.amazon.com/Xiaomi-Redmi-Note-Snapdragon-Black/dp/B07PY52GVP', 'https://m.media-amazon.com/images/I/61ZaskM5hBL._AC_UY218_ML3_.jpg', 339),
('thomas solberg', 'great phone', 'Love this phone. wish that motorola made a version that had talking texts as an option, for vision impaired left.', 5, 'B07PZZLR4D', 'Motorola', 'Motorola Moto G7 (64GB, 4GB RAM) Dual SIM 6.2\" 4G LTE (GSM Only) Factory Unlocked Smartphone International Model XT1962-6 International Version No Warranty', 'https://www.amazon.com/Motorola-Unlocked-Smartphone-International-XT1962-6/dp/B07PZZLR4D', 'https://m.media-amazon.com/images/I/612zkGD+cKL._AC_UY218_ML3_.jpg', 340),
('HeavyHarrison', 'Great phone with 2 catches', 'A rugged flip phone with a good feel and features. Call clarity is excellent. Reception is excellent. Two catches, it cannot be activated on the Verizon prepaid network. Verizon tech support said the software was incompatible with their service and they were working on it even though the phone was made for Verizon with their logos and software. Catch two, the phone can be activated on Page Plus and has a better priced plan. The voice mail cannot be set up to work, even with tech support from Page Plus. Some Verizon features and programs will not work. Some bloatware cannot be uninstalled like the Bing search. I love the phone, the reception on the CDMA network, the ruggedness, the long batte', 5, 'B07Q6VQ147', 'Apple', 'Apple iPhone 7, 128GB, Rose Gold - Fully Unlocked (Renewed)', 'https://www.amazon.com/Apple-iPhone-128GB-Rose-Gold/dp/B07Q6VQ147', 'https://m.media-amazon.com/images/I/71x3e0x+M2L._AC_UY218_ML3_.jpg', 341),
('Joseph Toland', 'short battery life', 'Overall, I like the phone. However I was hoping for a battery life comparable to my old flip phone which was well over a week before it started going to three bars. With this phone I go to three bars after about two days, and then quite quickly to two bars and one bar. I thought it might have come with an old battery, so I bought a replacement battery but I still had the same problem, so I suspect the phone is just an energy hog to some degree. I am a physician, and carried a smart phone primarily for the Internet, and a flip phone to make and receive phone calls so that I would not have to worry about the battery dying on me, so this is a bit of a disappointment.', 4, 'B07Q6ZNJNT', 'Samsung', 'Samsung Galaxy A10 A105M 32GB Duos GSM Unlocked Phone w/ 13MP Camera - Blue', 'https://www.amazon.com/Samsung-Galaxy-A10-Unlocked-Camera/dp/B07Q6ZNJNT', 'https://m.media-amazon.com/images/I/711v+hjDjxL._AC_UY218_ML3_.jpg', 342),
('Joseph', 'No longer charges new battery 100%.', 'Phone no longer charges new battery 100%. Swapped battery from other V860, but it still fails to charge 100%. The only way I have improved this failure is to turn the phone off, flip it open, then plugin and charge it while it is opened. Weird, but it works.', 3, 'B07Q8BY2Q8', 'Samsung', 'Samsung Galaxy A6 SM-A600P 32GB Black (Boost Mobile)(Renewed)', 'https://www.amazon.com/Samsung-Galaxy-SM-A600P-Mobile-Renewed/dp/B07Q8BY2Q8', 'https://m.media-amazon.com/images/I/61DuYC-cy4L._AC_UY218_ML3_.jpg', 343),
('T. David Brown', 'exceeded expectation', 'this phone has exceeded my expectations, would definitely refer others seeking a simular type phone to consider this phone. The only thing I wish was different, is that there if was a data/charge cord from the computer to the phone, because since I live in nursing home there are shortages of available electrical outlates and its easier amd safer to just be able to use a usb port to be able to charge my phone', 5, 'B07QB8QYYZ', 'Xiaomi', 'Xiaomi Mi 9 SE Unlocked 6GB/64GB Dual Sim 4G LTE Phone (International Global Version, No Warranty) (Ocean Blue)', 'https://www.amazon.com/Xiaomi-Unlocked-International-Version-Warranty/dp/B07QB8QYYZ', 'https://m.media-amazon.com/images/I/41UrCG1gkRL._AC_UY218_ML3_.jpg', 344),
('birdiebird', 'First choice for a rugged phone', 'This phone is the perfect choice if you work in an outdoor environment, It is an extremely sturdy phone and can survive quite a bit of abuse. the sound is exceptionally clear and allows increased volume in noisy situations. It was advertised as not including a camera but it has one and takes great pictures. All in all, this is a great cell phone. This is the fourth one in our family in five years and we all prefer this model.', 5, 'B07QBJZ34C', 'Motorola', 'Motorola Moto G6 Play 16GB - 5.7\" 4G LTE Unlocked Smartphone, US Version, XT1922-9 (Deep Indigo) (Renewed)', 'https://www.amazon.com/Motorola-Moto-Play-16GB-Smartphone/dp/B07QBJZ34C', 'https://m.media-amazon.com/images/I/71wROsSBiRL._AC_UY218_ML3_.jpg', 345),
('Debra', 'NOT yet', 'I love this phone, the reason is its like the one I have now...Have yet to add to my verizonwireless account, Do not know if it works or not...So, as with anything ,.,YES, I stand by rating only because my last worked awesomely. ALSO, I was under the understanding that this was a New phone...Did not look like one...also,and my phone is water proof but the instructions stated, this one is not, but it has all same information as with my last... ask me again in month...May have a better rating...', 3, 'B07QC4R451', 'Samsung', 'Samsung Galaxy A10 SM-A105FDS 32GB, Dual Sim, 6.2\" HD + Infinity-V Display, 2GB RAM, GSM Unlocked International Model, No Warranty (Black)', 'https://www.amazon.com/Samsung-SM-A105FDS-Infinity-V-Unlocked-International/dp/B07QC4R451', 'https://m.media-amazon.com/images/I/611v1lZLoJL._AC_UY218_ML3_.jpg', 346),
('Clay', 'Great for the price', 'The only complaint I have is that there is no flash. But the phone has geat reception, great display, easy to use, holds a charge, an all together simple and reliable cell phone. And for $35 delivered, I cant complain about a single thing......except for no flash.....lol.... I like it so much, Im thinking of getting another for a back-up. For the price and reliability, I have no choice but to give it 5 stars', 5, 'B07QCQ9JRH', 'Samsung', 'Samsung Galaxy M10 M105M 16GB Unlocked GSM Phone w/Dual 13 MP & 5 MP Camera - Ocean Blue', 'https://www.amazon.com/Samsung-Galaxy-M105M-Unlocked-Camera/dp/B07QCQ9JRH', 'https://m.media-amazon.com/images/I/41msGeobyxL._AC_UY218_ML3_.jpg', 347),
('KWNX', 'BackUp Assistant Reset Procedure', 'Here are three different functions/procedures:#3-Cellebrite,(machine)a way to transfer your contacts from one cell phone to another. Need to have it done at a VZ Wireless store.#2-Flash, a way to have your cell phone reset back to Factory Default settings. Need to have it done at a VZ Direct Store (Verizon owned). Then you will be able to download and reinstall Back-Up Assistant.#1-From Media Center-Browse & Download...launch Back-Up Assistant...(lower left) launch HELP...once on the Help screen just type *73738#...the screen will close and take you to your \"reset\" Back-Up Assistant...when it ask for the pin# type in yours.....I hope this helps.', 5, 'B07QCXPP71', 'Xiaomi', 'Xiaomi Redmi 7 64GB + 3GB RAM 6.26\" HD+ LTE Factory Unlocked GSM Smartphone (Global Version) (Comet Blue)', 'https://www.amazon.com/Xiaomi-Unlocked-Smartphone-Global-Version/dp/B07QCXPP71', 'https://m.media-amazon.com/images/I/51+GWFYhjUL._AC_UY218_ML3_.jpg', 348),
('Deborah Lobb', 'Cannot be programmed', 'Purchased this phone because it has been the phone my husband has used for years. It was stated that it could be used if you had an existing Verizon account. That does not work. It is not longer available for programing. Disappointed..', 3, 'B07QD67Z1Y', 'Samsung', 'Samsung Galaxy A50 A505F 128GB Dual SIM Unlocked GSM Phone w/ Triple (25MP+8MP+5MP) Camera - Black', 'https://www.amazon.com/Samsung-SM-A505F-Dual-SIM-6-4-Inch-Smartphone/dp/B07QD67Z1Y', 'https://m.media-amazon.com/images/I/41FaKE61LWL._AC_UY218_ML3_.jpg', 349),
('Vivi Carden', 'The price was really good; it appeared to be brand new', 'We had used this phone before, so we were familiar with it. The price was really good; it appeared to be brand new. Still a few resisting change, but this phone does what we need it to do.', 5, 'B07QFS3L4G', 'Samsung', 'Samsung Galaxy M20 M205M 32GB Unlocked GSM Phone w/Dual 13 MP & 5 MP Camera - Charcoal Black', 'https://www.amazon.com/Samsung-Galaxy-M20-Unlocked-Camera/dp/B07QFS3L4G', 'https://m.media-amazon.com/images/I/418T9z1d6zL._AC_UY218_ML3_.jpg', 350),
('LindsB', 'Definitely refurbished', 'The back of ours isnt closing correctly and also has faulty keypad. Without those two, the phone is great, but becareful. Refurbished does mean something has been wrong with it before.', 1, 'B07QGG4654', 'Samsung', 'Samsung Galaxy Note 9 N960U 128GB T-Mobile GSM Unlocked Phone (Ocean Blue, 128GB)(Renewed)', 'https://www.amazon.com/Samsung-Galaxy-T-Mobile-Unlocked-Renewed/dp/B07QGG4654', 'https://m.media-amazon.com/images/I/61seKW0ojYL._AC_UY218_ML3_.jpg', 351),
