('retiredlady', 'Great cell!!', 'I just want a cell to talk. I have ruined several because of moisture. This one has sort of a rubbery cover on keys and has lasted me longer than any phone I have had in a very long time. For those who just want a cell to \"talk\", this is a great phone.', 5, 'B07QP9ZMQH', 'Samsung', 'Samsung Galaxy A40 SM-A405F/DS Dual-SIM (64GB ROM, 4GB RAM, 5.9-Inch, GSM Only, No CDMA) Factory Unlocked 4G/LTE Smartphone - International Version (Black)', 'https://www.amazon.com/Samsung-SM-A405F-Dual-SIM-5-9-Inch-Smartphone/dp/B07QP9ZMQH', 'https://m.media-amazon.com/images/I/91VEhm3hwmL._AC_UY218_ML3_.jpg', 353),
('Daniel L.', 'used phone still the way to go', 'These are pretty bullet proof phones and are good for buying used phones. I Ordered two of these after flushing my old faithful down into the depths of the earth, one from NC and this one from Texas. The other phone ordered from the NC reseller was in my mailbox two days after the ordered and was in great shape with a new fresh charged battery and is currently living in my pocket. However this phone arrived a week and a half later with a flat battery and a lot of battle scars but still was in working order. Like I said this model is bullet proof otherwise I wonder if the outcome would have been the same with a more fragile version of flip phone. I gave three stars because of the long wait, f', 3, 'B07QQYHSR5', 'Samsung', 'Samsung Galaxy A50 A505G 64GB Duos GSM Unlocked Phone w/Triple 25MP Camera - Blue', 'https://www.amazon.com/Samsung-Galaxy-Unlocked-Triple-Camera/dp/B07QQYHSR5', 'https://m.media-amazon.com/images/I/81SMrSvqUWL._AC_UY218_ML3_.jpg', 354),
