('Alysse', 'Not worth my time and money', 'My husband used this phone for about a week. Never dropped it or got it wet and the screen went black then would not come back on. A few days later the phone all of a sudden comes to life. Very weird.', 2, 'B07QWNFKFF', 'Motorola', 'Motorola Moto X Force XT1580 64GB Black, 5.4\", Unlocked GSM Smartphone, International Stock, No Warranty', 'https://www.amazon.com/Motorola-Unlocked-Smartphone-International-Warranty/dp/B07QWNFKFF', 'https://m.media-amazon.com/images/I/41H5hvbeGNL._AC_UY218_ML3_.jpg', 356),
