('mm28302', 'Great Phone', 'I purchased this phone for my dad who works in asphalt and construction. He loves the camera for taking photos of his grandkids and pets. The only conplaint we have is the battery life is terrible but we will purchase a new extended life battery. I paid 35 dollars for the phone and I am satisfied with the quality for that price.', 5, 'B07R57VRJ7', 'Samsung', 'Samsung Galaxy A70 (SM-A7050) 6GB / 128GB 6.7-inches Dual SIM Factory Unlocked - No Warranty (Blue)', 'https://www.amazon.com/Samsung-SM-A7050-6-7-inches-Factory-Unlocked/dp/B07R57VRJ7', 'https://m.media-amazon.com/images/I/61HQhbnTQkL._AC_UY218_ML3_.jpg', 358),
